import { useState } from "react";

const Schedule = () =>
{
    const [schedule, setSchedule] = useState([
        {
        "id": 7,
        "day_of_week": "monday",
        "start_time": "09:00:00",
        "end_time": "09:45:00",
        "class_name": "geography",
        "classroom": 214,
        "schedule": 1
    },])

    return (
        <div>
            <h1 style={{textAlign: 'center'}}>Расписание</h1>
            <DayOfWeek day = "Вторник"/>
        </div>
        
    )
}

export default Schedule;
